import React, {Component} from 'react';

class List extends Component {
    constructor(){
        super();
    }

    render(){
        return(
            <ul>
                {
                    Tasks.map((Task, index) => <p 
                                                key={index} 
                                                style={{width: 400}}>{Task}</p>)
                }
            </ul>
        )
    }
}




export default List;
